// Carousal Pictures
;
(function() {
	var data = ['data:image/jpg;base64,',
		'data:image/jpg;base64,',
		'data:image/jpg;base64,',
		'data:image/jpg;base64,',
		'data:image/jpg;base64,'
	];
	var index = Math.ceil(Math.random() * 5) - 1;
	if(index != 0) {
		document.getElementById('head-img').src = data[index];
	}

	// Blur Effect By Mouse
	document.getElementsByTagName('header')[0].onmouseenter = function() {
		document.getElementById('head-img').classList.toggle('blur');
		document.getElementsByClassName('mask')[0].classList.remove('gradient');
	}
	document.getElementsByTagName('header')[0].onmouseleave = function() {
		document.getElementById('head-img').classList.toggle('blur');
		document.getElementsByClassName('mask')[0].classList.add('gradient');
	}

	// Show Nav Menu When Screen Scroll To Bottom Of Header
	var nav = document.getElementById('nav'),
		bgHeight = parseInt(getStyle(document.getElementsByTagName('header')[0], 'height'));

	function onMouseWheel() { /*当鼠标滚轮事件发生时，执行一些操作*/
		var scrollHeight = getScrollHeight();
		if(scrollHeight > bgHeight) {
			nav.style.display = 'block';
			nav.classList.add('slideDown');
			nav.classList.remove('slideUp');
		} else {
			nav.classList.remove('slideDown');
			nav.classList.add('slideUp');
			setTimeout(function() {
				nav.style.display = 'none';
			}, 500);
		}
	}

	window.onload = function() {
		onMouseWheel();
	}
	window.onscroll = function() {
		onMouseWheel();
	}

	function getStyle(obj, attr) {
		return obj.currentStyle ? obj.currentStyle[attr] : window.getComputedStyle(obj, null)[attr];
	}

	function getScrollHeight() {
		var scrollTop = 0;
		if(document.documentElement && document.documentElement.scrollTop) {
			scrollTop = document.documentElement.scrollTop;
		} else if(document.body) {
			scrollTop = document.body.scrollTop;
		}
		return scrollTop;
	}

	function addEventHandler(element, event, fun) {
		if(element.addEventListener) {
			element.addEventListener(event, fun, false);
		} else if(element.attachEvent()) { // 兼容IE
			element.attachEvent('on' + event, fun)
		} else {
			element['on' + event] = fun;
		}
	}
})();